import React from 'react';
import Sidebar from '../../components/sidebar/Sidebar';
import Topbar from '../../components/topbar/Topbar';

import {BrowserRouter as Router, Switch, Route} from 'react-router-dom'

import Home from '../../pages/home/Home';
import Login from '../../pages/login/Login';
import UserList from '../../pages/userList/UserList';
import DificultList from '../../pages/dificultList/DificultList';
import ParkList from '../../pages/parkList/ParkList';
import RoutineList from '../../pages/routineList/RoutineList';
import NewList from '../../pages/newList/NewList';
import ProfileList from '../../pages/profileList/ProfileList';
import EventList from '../../pages/eventList/EventList';
import ExerciceList from '../../pages/exerciceList/ExerciceList';
import InstructorList from '../../pages/instructorList/InstructorList';


function Dashboard() {
  return (
    <Router>
      <Topbar />
      <div className="container">
        <Sidebar />
        <Switch>

          <Route path='/dashboard/home'>
            <Home />
          </Route>
          <Route path='/users'>
            <UserList />
          </Route>
          <Route path='/dificults'>
            <DificultList />
          </Route>
          <Route path='/exercices'>
            <ExerciceList />
          </Route>
          <Route path='/parks'>
            <ParkList />
          </Route>
          <Route path='/routines'>
            <RoutineList />
          </Route>
          <Route path='/news'>
            <NewList />
          </Route>
          <Route path='/events'>
            <EventList />
          </Route>
          <Route path='/profiles'>
            <ProfileList />
          </Route>
          <Route path='/instructor'>
            <InstructorList />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default Dashboard;
